import React, { useState, useEffect } from 'react';
import { connect } from "react-redux";
import './Heatup.css'
import { heatupAC } from "../../redux/actions/actions";

import ExerciseContainer from '../ExerciseContainer/ExerciseContainer'

function Heatup(props) {

    fetch('/exercises')

    return (
        <>
            <ExerciseContainer heatup={props.heatup}/>
        </>
    )
}

const mapDispatchToProps = dispatch => {
    return {
        heatup: (exercise) => { dispatch(heatupAC(exercise)) },
    }
}


export default connect(
    null,
    mapDispatchToProps,
)(Heatup);
